import React, { useState } from 'react';
import './Projects.css';

const Projects = () => {
  const [projects, setProjects] = useState([]);
  const [showUploadForm, setShowUploadForm] = useState(false);
  const [newProject, setNewProject] = useState({
    title: '',
    description: '',
    technologies: '',
    imageUrl: '',
    projectUrl: '',
    githubUrl: ''
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewProject({
      ...newProject,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setProjects([...projects, { ...newProject, id: Date.now() }]);
    setNewProject({
      title: '',
      description: '',
      technologies: '',
      imageUrl: '',
      projectUrl: '',
      githubUrl: ''
    });
    setShowUploadForm(false);
  };

  return (
    <section id="projects" className="projects-section">
      <div className="container">
        <h2 className="section-title">My Projects</h2>
        <p className="section-description">
          Here are some of the web applications I've built. Each project showcases different skills and technologies.
        </p>

        <div className="add-project">
          <button 
            className="add-project-btn"
            onClick={() => setShowUploadForm(!showUploadForm)}
          >
            {showUploadForm ? 'Cancel' : 'Add New Project'}
          </button>
        </div>

        {showUploadForm && (
          <div className="upload-form-container">
            <h3>Add New Project</h3>
            <form onSubmit={handleSubmit} className="upload-form">
              <div className="form-group">
                <label htmlFor="title">Project Title</label>
                <input
                  type="text"
                  id="title"
                  name="title"
                  value={newProject.title}
                  onChange={handleInputChange}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="description">Description</label>
                <textarea
                  id="description"
                  name="description"
                  value={newProject.description}
                  onChange={handleInputChange}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="technologies">Technologies Used</label>
                <input
                  type="text"
                  id="technologies"
                  name="technologies"
                  value={newProject.technologies}
                  onChange={handleInputChange}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="imageUrl">Image URL</label>
                <input
                  type="url"
                  id="imageUrl"
                  name="imageUrl"
                  value={newProject.imageUrl}
                  onChange={handleInputChange}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="projectUrl">Project URL</label>
                <input
                  type="url"
                  id="projectUrl"
                  name="projectUrl"
                  value={newProject.projectUrl}
                  onChange={handleInputChange}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="githubUrl">GitHub URL</label>
                <input
                  type="url"
                  id="githubUrl"
                  name="githubUrl"
                  value={newProject.githubUrl}
                  onChange={handleInputChange}
                />
              </div>

              <button type="submit" className="submit-btn">Add Project</button>
            </form>
          </div>
        )}

        <div className="projects-grid">
          {projects.length > 0 ? (
            projects.map(project => (
              <div key={project.id} className="project-card">
                <div className="project-image">
                  <img src={project.imageUrl} alt={project.title} />
                </div>
                <div className="project-content">
                  <h3>{project.title}</h3>
                  <p>{project.description}</p>
                  <div className="project-tech">
                    <span>Technologies: {project.technologies}</span>
                  </div>
                  <div className="project-links">
                    <a href={project.projectUrl} target="_blank" rel="noopener noreferrer" className="btn">View Project</a>
                    {project.githubUrl && (
                      <a href={project.githubUrl} target="_blank" rel="noopener noreferrer" className="btn btn-secondary">GitHub</a>
                    )}
                  </div>
                </div>
              </div>
            ))
          ) : (
            <div className="no-projects">
              <p>No projects added yet. Click "Add New Project" to get started.</p>
            </div>
          )}
        </div>
      </div>
    </section>
  );
};

export default Projects;
